import React from 'react';
import ReactDOM from 'react-dom';
import './Header.css'
// import "../general/Menu/Menu.js";
// import "../general/Menu/Menu.css";

class Header extends React.Component {
  render()
  {
    return (
    <>
    <div>HELLO WORLD</div>
    <nav id="header" class="container-fluid px-0 navbar navbar-expand-md font-weight-bold">
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsibleNavbar">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="collapsibleNavbar">
            <ul class="navbar-nav container-fluid d-flex justify-content-start secondTitle headerSize">
              <li class="nav-item px-1">
                <a class="nav-link txtHeader" href="home.html">Home</a>
              </li>
              <li class="nav-item px-1">
                <a class="nav-link txtHeader" href="projects.html">Projects</a>
              </li>
              <li class="nav-item px-1">
                <a class="nav-link txtHeader" href="#">Services</a>
              </li>
              <li class="nav-item px-1">
                <a class="nav-link txtHeader" href="#">Office</a>
              </li>
              <li class="nav-item px-1 txtHeader">
                <a class="nav-link txtHeader" href="contactUs.html">Contact Us</a>
              </li>
              <li class="nav-item ml-auto">
                <a class="nav-link txtHeader" href="#">Login<i class="fas fa-user-plus px-2"></i></a>
              </li>
            </ul>
          </div>
        </nav>
    </> 
    );

  }
}

export default Header;
